import 'bootstrap/dist/css/bootstrap.min.css'
import Axios from 'axios'
import { useState, useEffect } from 'react'

function App() {
  const [datosUsuarios, setUsuarios] = useState([])

  const getAllUsuarios = () => {
    Axios.get('http://localhost:3001/getAllUsuarios').then((response) => {
      setUsuarios(response.data)
      console.log(response)
    })
  }

  useEffect(() => {
    getAllUsuarios()
  }, [0])

  return (
    <div className="App">
      <div className="container-fluid p-2 bg-success">Hola mundo</div>
      {
        datosUsuarios.map(item => {
          return <p className='fw-bold' key={item.id_usuario}>{item.nombre_usuario}</p>
        })
      }
    </div>
  );
}

export default App;
